import logo from './logo.svg';
import './App.css';
import './bootstrap-5.2.3-dist/css/bootstrap-grid.min.css';
import './bootstrap-5.2.3-dist/js/bootstrap.bundle.min.js';
import Dau from './DoAn/Dau';
import Banner from './DoAn/Banner';
import LoaiSP from './DoAn/Loai_San_Pham';
import HeaderLoai from './DoAn/headerLoai';
import { Route } from 'react-router-dom';


const Member=[
  {
    IMGSP: "anh_1.jpg",
    NameSP: "SP thu 1",
    PriceSP: 50000,
  }];

for (let i=1;i<8;i++){
  Member[i]={IMGSP: "anh_1.jpg",
  NameSP: "SP thu "+i,
  PriceSP: 50000,}
}



function App() {
  const listMember= Member.map(function(item){
    return (
      <LoaiSP member={item}/>
  );
  });
  return (

    <Routes>

    <Dau/>
    <Banner/>
    <div class="bodySP">
    <HeaderLoai/>
    <div class="row">
    {listMember}
    </div>
    </div>

    </Routes>


  );
}

export default App;
